import axios from "axios";
import React, { useState, useEffect } from "react";
import MenuBar from '../../components/MenuBar'
import Footer from "../../components/Footer";
import Comment_data from "../../components/mypageComponents/comments_data";
import Comments_privacy from "../../components/mypageComponents/comments_privacy";

const Adminpage = () => {
  const [boolUser, setBoolReview] = useState(false);
  const [boolHospital, setBoolHospital] = useState(false);
  const [boolReports, setBoolReports] = useState(false);

  useEffect(() => {
  }, []);

  const ReviewArea = async (e) => {
    setBoolReview(true)
}

  const UserArea = async (e) => {
    setBoolUser(!(boolUser))
    setBoolHospital(false)
    setBoolReports(false)
  }

  const HospitalArea = async (e) => {
    setBoolUser(false)
    setBoolHospital(!(boolHospital))
    setBoolReports(false)
  }

  const ReportsArea = async (e) => {
    setBoolUser(false)
    setBoolHospital(false)
    setBoolReports(!(boolReports))
  }



    return (
        <div className="App">
          <MenuBar></MenuBar>
          <div className="MainTopDiv">
            <span className="MainTopSpan">관리자 페이지</span>
          </div>

          <div className="mypage_Area">
            <button className={boolUser ? 'mypage_AreaBtnActive' : 'mypage_AreaBtn'} onClick={e => ReviewArea(e)}>회원관리</button>
            <button className={boolHospital ? 'mypage_AreaBtnActive' : 'mypage_AreaBtn'} onClick={e => ReviewArea(e)}>병원신고현황</button>
            <button className={boolReports ? 'mypage_AreaBtnActive' : 'mypage_AreaBtn'} onClick={e => ReviewArea(e)}>신고접수관리</button>
          </div>


          {
            boolUser ?
            <Comment_data></Comment_data>
            : 
            <Comments_privacy></Comments_privacy>
          }
          {
            boolHospital ?
            <Comment_data></Comment_data>
            : 
            <Comments_privacy></Comments_privacy>
          }
          {
            boolReports ?
            <Comment_data></Comment_data>
            : 
            <Comments_privacy></Comments_privacy>
          }



          <Footer></Footer>
        </div>
    );
}

export default Adminpage;
